import s from './MyPosts.module.css';
import Post from './Post/Post';
const MyPosts = () => {
    return (
        <div className={s.postBlock}>
            My posts
            <div>
                <div>
                    <textarea></textarea>
                </div>
                <div>
                    <button>add post</button>
                </div>
            </div>
            <div className={s.posts}>
                <Post massage="Hi, how are you?" likeCount="0" />
                <Post massage="It's my first post!" likeCount="23"/>
            </div>
        </div>
    )
}

export default MyPosts;
